datamodel:
// This is your Prisma schema file,
// learn more about it in the docs: https://pris.ly/d/prisma-schema

generator client {
  provider = "dart run orm"
  output = "../lib/prisma/generated"
}

datasource db {
  provider = "sqlite"
  url      = "file:../db.sqlite"
}

model Account {
   id Int @id @default(autoincrement())
   name String
   total Float
   primary Boolean
}
